import axios from "axios"


class CountryService {

    getAllTCountries(username) {
        return axios.get(`http://localhost:8080/admins/${username}/countries`)
    }

    deleteTodo(username,id) {
        return axios.delete(`http://localhost:8080/admins/${username}/todos/${id}`)
    }

    retrieveTodo(username,id) {
        return axios.get(`http://localhost:8080/users/${username}/todos/${id}`)
    }

    updateCountry(username,id,country) {
        return axios.put(`http://localhost:8080/admins/${username}/countries/${id}`,country)
    }

    addTodo(username,todo) {
        return axios.post(`http://localhost:8080/users/${username}/todos`,todo)
    }
    
}

export default new CountryService()
